public class Player {

    private String name;
    private int number;
    private int goalsScored = 0;

    public Player(String name, int number) {
        this.name = name;
        this.number = number;
    }

    public void increaseGoalsScored() {
        goalsScored++;
    }

    public int getGoalsScored() {
        return goalsScored;
    }

    public String getName() {
        return name;
    }

    public int getNumber() {
        return number;
    }
}
